handle.createQuery(query).map(new org.skife.jdbi.v2.tweak.ResultSetMapper<com.metamx.common.Pair<java.lang.Object, java.lang.String>>() {
    @java.lang.Override
    public com.metamx.common.Pair<java.lang.Object, java.lang.String> map(final int index, final java.sql.ResultSet r, final org.skife.jdbi.v2.StatementContext ctx) throws java.sql.SQLException {
        java.lang.String[] key = new java.lang.String[keyColumns.size()];
        int idx = 0;
        for (java.lang.String keyColumn : keyColumns) {
            key[(idx++)] = r.getString(keyColumn);
        }
        return new com.metamx.common.Pair<java.lang.Object, java.lang.String>(new org.apache.commons.collections.keyvalue.MultiKey(key, false), r.getString(valueColumn));
    }
}).list()

handle.createQuery(query).map(new org.skife.jdbi.v2.tweak.ResultSetMapper<com.metamx.common.Pair<java.lang.Object, java.lang.String>>() {
    @java.lang.Override
    public com.metamx.common.Pair<java.lang.Object, java.lang.String> map(final int index, final java.sql.ResultSet r, final org.skife.jdbi.v2.StatementContext ctx) throws java.sql.SQLException {
        return new com.metamx.common.Pair<java.lang.Object, java.lang.String>(r.getString(keyColumns.get(0)), r.getString(valueColumn));
    }
}).list()
